import React from "react";
import Card from "../../components/Card/Card";
import { useNavigate } from "react-router-dom";


export default function DashboardIdoso() {
    const nav = useNavigate();
    return (
        <div style={{ padding: 24 }}>
            <h2>Dashboard do Idoso</h2>
            <div style={{ display: "flex", gap: 16, marginTop: 16, flexWrap: "wrap" }}>
                <Card title="Lista de Desejos" description="Ver e gerenciar seus desejos" onClick={() => nav('/idoso/lista-desejos')}>
                    <div style={{ marginTop: 12 }}><button onClick={() => nav('/idoso/lista-desejos')}>Abrir</button></div>
                </Card>


                <Card title="Notificações" description="Ver mensagens e alertas" onClick={() => nav('/idoso/notificacoes') }>
                    <div style={{ marginTop: 12 }}><button onClick={() => nav('/idoso/notificacoes')}>Abrir</button></div>
                </Card>


                <Card title="Configurações" description="Editar perfil e preferências" onClick={() => nav('/config') }>
                    <div style={{ marginTop: 12 }}><button onClick={() => nav('/config')}>Abrir</button></div>
                </Card>
            </div>
        </div>
    );
}
